const viewer = new Cesium.Viewer("cesiumContainer", {
  imageryProvider: new Cesium.TileMapServiceImageryProvider({
    url: Cesium.buildModuleUrl("Assets/Textures/NaturalEarthII"),
  }),
  baseLayerPicker: false,
  geocoder: false,
  homeButton: false,
  infoBox: false,
  navigationHelpButton: false,
  sceneModePicker: false,
});
viewer.scene.globe.enableLighting = true;

const StarLink_24 = `1 44238U 19029D   21346.90763308  .00004453  00000+0  22516-3 0  9998
2 44238  52.9966 252.5934 0002926  91.7992 268.3337 15.18994418139775`;

const liveSatellite = [
  {
    id: 0,
    title: "STARLINK-24",
    tle: "1 44238U 19029D   21349.40785262  .00005641  00000+0  28092-3 0  9994 &#10 2 44238  52.9961 241.1340 0002909  98.2402 261.8922 15.19025283141816",
  },
];

class LiveSatellite {
  constructor(id, title, tle) {
    this.id = id;
    this.title = title;
    this.tle = tle;
  }
}

class SatList {
  constructor(satellites) {
    this.nextId = satellites.length;
    this.satellites = satellites;
  }
  addSatellite(title, tle) {
    const newSat = new LiveSatellite(this.nextId++, title, tle);
    this.satellites.push(newSat);

    const tbody = document.getElementById("tableBody");
    const tr = document.createElement("tr");
    const td = document.createElement("td");
    td.textContent = newSat.title;
    td.title = newSat.tle;

    tr.appendChild(td);
    tbody.appendChild(tr);
  }
}

const satList = new SatList(liveSatellite);

const satrec = satellite.twoline2satrec(
  StarLink_24.split("\n")[0].trim(),
  StarLink_24.split("\n")[1].trim()
);

const totalSeconds = 60 * 60 * 6;
const timestepInSeconds = 10;
const start = Cesium.JulianDate.fromDate(new Date());
const stop = Cesium.JulianDate.addSeconds(
  start,
  totalSeconds,
  new Cesium.JulianDate()
);
viewer.clock.startTime = start.clone();
viewer.clock.stopTime = stop.clone();
viewer.clock.currentTime = start.clone();
viewer.timeline.zoomTo(start, stop);
viewer.clock.multiplier = 40;
viewer.clock.clockRange = Cesium.ClockRange.LOOP_STOP;

const positionsOverTime = new Cesium.SampledPositionProperty();
for (let i = 0; i < totalSeconds; i += timestepInSeconds) {
  const time = Cesium.JulianDate.addSeconds(start, i, new Cesium.JulianDate());
  const jsDate = Cesium.JulianDate.toDate(time);

  const positionAndVelocity = satellite.propagate(satrec, jsDate);
  const gmst = satellite.gstime(jsDate);
  const p = satellite.eciToGeodetic(positionAndVelocity.position, gmst);

  const position = Cesium.Cartesian3.fromRadians(
    p.longitude,
    p.latitude,
    p.height * 550
  ); // Pull Position from SatelliteJS
  positionsOverTime.addSample(time, position);
}

const satellitePoint = viewer.entities.add({
  position: positionsOverTime,
  billboard: {
    image: getDataUrl(),
    scale: 1.0,
    scaleByDistance: new Cesium.NearFarScalar(0, 1.5, 8.0e6, 0.05),
    //scaleByDistance: new Cesium.NearFarScalar(1.5e2, 1.5, 8.0e6, 0.0),
  },
});

var pinBuilder = new Cesium.PinBuilder();

var bluePin = viewer.entities.add({
  name: "Blank blue pin",
  position: Cesium.Cartesian3.fromDegrees(
    -104.95242363746804,
    40.12636140128358
  ),
  billboard: {
    image: pinBuilder.fromText("H", Cesium.Color.ROYALBLUE, 48).toDataURL(),
    verticalOrigin: Cesium.VerticalOrigin.BOTTOM,
    scale: 1.0,
    scaleByDistance: new Cesium.NearFarScalar(1, 1.5, 8.0e6, 0.75),
  },
});

// viewer.trackedEntity = satellitePoint;

let initialized = false;
viewer.scene.globe.tileLoadProgressEvent.addEventListener(() => {
  if (!initialized && viewer.scene.globe.tilesLoaded === true) {
    viewer.clock.shouldAnimate = false; // change to true to have it run when loaded
    initialized = true;
    viewer.scene.camera.zoomOut(7000000);
  }
});

let satelliteInput = {};

const tleInput = document.querySelector(".satInput");

const tleButton = document.querySelector(".tleButton");

const homeInput = document.querySelector(".homeInput");

const homeButton = document.querySelector(".homeButton");

homeButton.addEventListener("click", updateHomeListener);
homeInput.addEventListener("keydown", updateHomeListener);

tleButton.addEventListener("click", addSatellite);

tleInput.addEventListener("keydown", addSatellite);

function addSatellite(event) {
  if (event.key == "Enter" || event.type == "click") setTLE(tleInput.value);
}

function updateHomeListener(event) {
  if (event.key == "Enter" || event.type == "click") setHome();
}

function setHome() {
  let values = homeInput.value.split(",");
  if (
    values.length != 2 ||
    isNaN(parseFloat(values[1].trim())) ||
    isNaN(parseFloat(values[0].trim()))
  ) {
    homeInput.style.border = "2px solid red";
    flashAlert(
      "Invalid Coordinates. Make sure you input the right format",
      "danger"
    );
  } else {
    bluePin.position = Cesium.Cartesian3.fromDegrees(
      parseFloat(values[1].trim()),
      parseFloat(values[0].trim())
    );
    homeInput.style.border = "none";
    homeInput.value = "";
    homeInput.blur();
    flashAlert("Successfully updated home!", "success");
  }
}

function setTLE(val) {
  let nextSat = val;

  try {
    tleInput.style.border = "none";
    let satData = nextSat.split("\n");

    if (satData.length != 3) throw new Error("Invalid Title and TLE paste");
    let satTitle = satData[0].trim();

    if (satList.satellites.find((sat) => sat.title == satTitle))
      throw new Error("Already tracking satellite");

    const satrec = satellite.twoline2satrec(
      satData[1].trim(),
      satData[2].trim()
    );

    const positionsOverTime = new Cesium.SampledPositionProperty();
    for (let i = 0; i < totalSeconds; i += timestepInSeconds) {
      const time = Cesium.JulianDate.addSeconds(
        start,
        i,
        new Cesium.JulianDate()
      );
      const jsDate = Cesium.JulianDate.toDate(time);

      const positionAndVelocity = satellite.propagate(satrec, jsDate);
      const gmst = satellite.gstime(jsDate);
      const p = satellite.eciToGeodetic(positionAndVelocity.position, gmst);

      const position = Cesium.Cartesian3.fromRadians(
        p.longitude,
        p.latitude,
        p.height * 550
      ); // Pull Position from SatelliteJS
      positionsOverTime.addSample(time, position);
    }
    viewer.entities.add({
      position: positionsOverTime,
      billboard: {
        image: getDataUrl(),
        scale: 1.0,
        scaleByDistance: new Cesium.NearFarScalar(0, 1.5, 8.0e6, 0.05),
      },
    });
    tleInput.value = "";
    tleInput.blur();

    satList.addSatellite(satTitle, satData[0] + satData[2]);
    flashAlert(`Tracking ${satData[0]} satellite!`, "success");
  } catch (error) {
    console.error(error);
    tleInput.style.border = "2px solid red";
    flashAlert(error.message, "danger");
  }
}

function flashAlert(msg, type) {
  let alertOpposites = {
    danger: "success",
    success: "danger",
  };

  let alert = document.querySelector(".alert");
  alert.textContent = msg;
  alert.classList.add(`alert-${type}`);
  alert.classList.remove(`alert-${alertOpposites[type]}`);
  alert.classList.remove("hidden");

  setTimeout(() => {
    alert.classList.add("hidden");
  }, 3000);
}

function getDataUrl() {
  return "data:image/png;base64,";
}
